import{d as a,c as e,o as t,V as r}from"./chunks/framework.Nh_IS0PD.js";const m=r('<h1 id="симметрия" tabindex="-1">Симметрия <a class="header-anchor" href="#симметрия" aria-label="Permalink to &quot;Симметрия&quot;">​</a></h1><h2 id="bilateral-symmetry" tabindex="-1">bilateral symmetry <a class="header-anchor" href="#bilateral-symmetry" aria-label="Permalink to &quot;bilateral symmetry&quot;">​</a></h2><p>Двухсторонняя симметрия, или билатеральная симметрия, характеризуется тем, что организм разделен на две симметричные половины поперечной плоскостью, что позволяет дифференцировать переднюю и заднюю части и обеспечивает эффективное передвижение.</p><h2 id="asymmetric" tabindex="-1">asymmetric <a class="header-anchor" href="#asymmetric" aria-label="Permalink to &quot;asymmetric&quot;">​</a></h2><p>Рисует изображение исключая повторяющиеся симмитричные элементы</p><h2 id="radial-symmetry" tabindex="-1">radial symmetry <a class="header-anchor" href="#radial-symmetry" aria-label="Permalink to &quot;radial symmetry&quot;">​</a></h2><p>Этот тип симметрии характеризуется тем, что организм имеет множество плоскостей симметрии, проходящих через центр организма. Это типично для некоторых животных, таких как медузы и морские звезды.</p><h2 id="spherical-symmetry" tabindex="-1">spherical symmetry <a class="header-anchor" href="#spherical-symmetry" aria-label="Permalink to &quot;spherical symmetry&quot;">​</a></h2><p>Это подтип радиальной симметрии, где организм симметричен относительно всех направлений в трехмерном пространстве. Примерами таких организмов могут служить некоторые простейшие и бактерии.</p><h2 id="segmental-symmetry" tabindex="-1">segmental symmetry <a class="header-anchor" href="#segmental-symmetry" aria-label="Permalink to &quot;segmental symmetry&quot;">​</a></h2><p>Организм имеет две или более повторяющиеся части, которые могут быть симметричными относительно друг друга. Это типично для некоторых червей и ракообразных.</p><h2 id="spiral-symmetry" tabindex="-1">spiral symmetry <a class="header-anchor" href="#spiral-symmetry" aria-label="Permalink to &quot;spiral symmetry&quot;">​</a></h2><p>Этот тип симметрии проявляется в организмах, которые обладают спирально образованными частями или структурами. Примерами могут служить некоторые раковины моллюсков и растения.</p><h2 id="multiaxial-symmetry" tabindex="-1">multiaxial symmetry <a class="header-anchor" href="#multiaxial-symmetry" aria-label="Permalink to &quot;multiaxial symmetry&quot;">​</a></h2><p>Организм имеет более одной плоскости симметрии. Это включает различные комбинации радиальной, сегментальной и других типов симметрии.</p>',15),s=[m],n=JSON.parse('{"title":"Симметрия","description":"","frontmatter":{},"headers":[],"relativePath":"camera/symmetry.md","filePath":"camera/symmetry.md","lastUpdated":1707036394000}'),l={name:"camera/symmetry.md"},c=a({...l,setup(i){return(y,o)=>(t(),e("div",null,s))}});export{n as __pageData,c as default};
